    <li className={classes.user}>
      <div className={classes.container}>
        <div class={classes.menu}>
          <div class={classes["menu-group"]}>
            <div class={classes["menu-item"]}>
              <img
                className={classes["menu-item-image"]}
                src={props.profilepic}
                alt={props.name}
              />

              <div class={classes["menu-item-text"]}>
                <h4 class={classes["menu-item-heading"]}>
                  <span class={classes["menu-item-name"]}>
                    <a href={props.url} target="_blank">
                      {props.username}
                    </a>
                  </span>
                  <span class={classes["menu-item-price"]}>{props.name}</span>
                </h4>
                <p class={classes["menu-item-description"]}>
                  <h5>{props.bio}</h5>
                  <br />
                  <h6 class={classes.color}>
                    <FaMapMarker />
                    {props.location}
                    &nbsp;&nbsp;&nbsp;&nbsp;
                    <FaEnvelope />
                    &nbsp;
                    {props.username}@gmail.com
                  </h6>
                </p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </li>
  );
};

export default User;
